      }

    }

    return (
      <> 
      <Box className='info_navbar'>
      <Tabs
          className='info_navbar-container'
          value={value}
          onChange={handleChange}
          variant="scrollable"
          scrollButtons="auto"

        >
          <Tab className='tab_size' label="Vaccination History" />
